import clsx from "clsx";
interface ButtonProps {
  title: string;
  type?: "primary" | "secondary";
  onClick?: () => void;
}
export default function Button({
  title,
  onClick = () => {},
  type = "primary",
}: ButtonProps) {
  return (
    <button
      className={clsx("py-4 w-full font-medium", {
        "bg-primary-1 text-white": type == "primary",
        "bg-white text-white": type == "secondary",
      })}
      onClick={onClick}
    >
      {title}
    </button>
  );
}
